import Socials from '../Socials/socials'
import './footer.scss'

function Footer() {
  return (
    <div className="Footer">
      <div className="socials-list">
        <Socials />
      </div>
      <p>Made with Effort!</p>
    </div>
  )
}

export default Footer;
